import React from "react";
import { Link } from "react-router-dom";
import "./styles/Movies.css"
const Movies = ({ props }) => {
  if(!props){
    return(
      <h1>No se encontraron resultados</h1>
    )
  }
  return (
    <div className="card-body">
      <ul>
     <img src={props.Poster} alt={props.Title} />
     </ul>
    </div>
  );
};

export default Movies;
